import React, { Component } from 'react';


class SignUp extends Component {

    render() {
        const mystyle = {
            color: "white",
            backgroundColor: "DodgerBlue",
            padding: "10px",
            fontFamily: "Arial"
        };
        return(
            <div style={mystyle}>
                Sign Up
            </div>
        );
    }
}

export default SignUp;
